import React from "react";

class  ProfileInfo extends React.Component{
    render(){

        return (
            <div>
                <ul style={{'listStyle':'none'}}>
                    <li>Nom: </li>
                    <li>Prenom: </li>
                    <li>Age:</li>
                </ul>
            </div>
        )
    }
}
export default ProfileInfo
